import mdlHerois from 'src/models/mdlHerois';
import mdlPoderes from './mdlPoderes';

export class mdlHeroisPoderes {
    heroiId?: number = 0;
    heroi?: mdlHerois;
    superPoderId?: number = 0;
    superPoder?: mdlPoderes;
}

export default mdlHeroisPoderes;
